import React from 'react'
import { Link } from 'react-router-dom'
import "./MenuItem.css" 

const MenuItem = ({title, path}) => {
  return (
    <div className='MenuItem__container'>
         <Link to={path}>{title}</Link>
    </div>

  )
}

export default MenuItem
